const comments = {
    state: {
        comments: [
            {
                user: 'username',
                date: '01-04-2023',
                stars: '4',
                comment: 'Хороший тест!',
                usersIdLikes: [1, 2],
                usersIdDislikes: [],
                liked: false,
                disliked: false,
                openedInput: false,
                inputValue: '',
                answered: [{
                    user: 'username',
                    date: '02-04-2023',
                    comment: 'Ответ на Хороший тест!',
                    usersIdLikes: [1, 2],
                    usersIdDislikes: [],
                    liked: false,
                    disliked: false,
                    answered: []
                }]
            },
            {
                user: 'some user',
                date: '12-03-2023',
                stars: '5',
                comment: 'Отличный тест!',
                usersIdLikes: [1, 2],
                usersIdDislikes: [],
                liked: false,
                disliked: false,
                openedInput: false,
                inputValue: '',
                answered: []
            }
        ]
    },
    getters: {
        getComments(state) {
            return state.comments
        }
    }
}

export default comments
